import { Link } from "react-router-dom";

const EVENTS = [
    {
        id: "e1",
        title: "some Event"
    },
    {
        id: "e2",
        title: "test event"
    }
]

function EventsPage() {
    return (
        <div>
            <h1>EventsPage</h1>
            <ul>
                {EVENTS.map((event) => (
                    <li key={event.id}>
                        <Link to={`/events/:${event.id}`}>{event.title}</Link>
                    </li>
                ))}
            </ul>
        </div>
    )
}


export default EventsPage;
